package com.tnsif.day1;

public class DesitionMakingWithOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x=8,y=7;
		int a=10,b=11;
		if(x<=y)
		{
			System.out.println("true");
		}
		else {
			System.out.println("false");
		}
		if(!(a<b)&&(a==b)) {//false&&false
			System.out.println("true");
		}
		else {
			System.out.println("false");
		}
			
		}

	}


